import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import PocetnaStranica from './PocetnaStranica';
import Registracija from './Registracija';
import Logovanje from './Logovanje';
import SviProizvodi from './SviProizvodi';


const App=()=>{
  return (
    <Router>
      <Switch>
          <Route exact path="/" Component={PocetnaStranica}/>
          <Route path="/registracija" Component={Registracija}/>
          <Route path="/logovanje" Component={Logovanje}/>
          <PrivateRoute path="/svi-proizvodi" Component={SviProizvodi}/>
      </Switch>
    </Router>
  );
};

const PrivateRoute=({component: Component, ...rest}) => {
  const isLoggedIn=true;

  return (
    <Route
    {...rest}
    render={(props)=> 
    isLoggedIn ? <Component {...props} /> : <Redirect to="/logovanje" />
    }
    />
  );
};


export default App;
